def mean_confidence_interval(data, confidence=0.95):
    a = 1.0 * np.array(data)
    n = len(a)
    m, se = np.mean(a), scipy.stats.sem(a)
    h = se * scipy.stats.t.ppf((1 + confidence) / 2., n-1)
    return m, m-h, m+h


for r in rewards:
    mean, minus, plus = mean_confidence_interval(rewards[r]['rewards'])
    print(r, mean, minus, plus)    



